import Layout from '../components/layout';
import dbConnect from '../utils/dbConnect';
import ItemInstance from '../models/iteminstance';

export default function About() {
    return (
        <Layout>
            <div className="container">
                <p>Name: Jiuhong Sun</p>

                <p>
                    Tel: <a href="tel:+86 18940960582">+86 18940960582</a>
                </p>
                <p>
                    Email:{' '}
                    <a href="mailto:jiu.hong.sun@gmail.com">
                        jiu.hong.sun@gmail.com
                    </a>
                </p>
            </div>
        </Layout>
    );
}

export async function getServerSideProps(req, res) {
    //export async function getServerSideProps() {
    await dbConnect();

    // find all the data in our database
    ItemInstance.find({ user: 'qbmdqff' })
        .populate('item')
        .then((items_cart) => {
            res.status(201).json({ status: 201, data: items_cart });
            res.end();
        })
        .catch((err) => {
            res.status(500).json({ status: 500, error: err });
            res.end();
        });

    return 'hello';
}
